import { makeStyles } from "@material-ui/core/styles";

export default makeStyles((theme) => ({

  container: {
    height: "600px",
    display: "flex",
    alignItems: "center",
    justifyContent: "center",
  },
  dashboard: {
    maxWidth: "360px",
    margin: "auto",
    textAlign: "center",
  },
}));
